def syllable(s):
    fin = []
    line = tlg_plaintext_cleanup(s, rm_punctuation=True, rm_periods=True) #removing all punctuation
    p = PunktLanguageVars()
    tokens = p.word_tokenize(line.lower()) #line to list of words
    for token in tokens:
        a = syllabify(token) #syllabifying using cltk module
        n = []
        for item in a:
            l = list(item)
            k = []
            for element in l:
                k.append(base(element)) #removing diacritics with cltk base to make length parsing easier
            n.append(''.join(k))
        fin.append(n)
    return fin #return list of lists of syllables

